class _UniffiConverterString:
    @staticmethod
    def check_lower(value):
        if not isinstance(value, str):
            raise TypeError("argument must be str, not {}".format(type(value).__name__))
        return value

    @staticmethod
    def read(buf):
        size = buf.read_i32()
        if size < 0:
            raise InternalError("Unexpected negative string length")
        utf8_bytes = buf.read(size)
        return utf8_bytes.decode("utf-8")

    @staticmethod
    def write(value, buf):
        utf8_bytes = value.encode("utf-8")
        buf.write_i32(len(utf8_bytes))
        buf.write(utf8_bytes)

    @staticmethod
    def lift(buf):
        with buf.consume_with_stream() as stream:
            return stream.read(stream.remaining()).decode("utf-8")

    @staticmethod
    def lower(value):
        with _UniffiRustBuffer.alloc_with_builder() as builder:
            builder.write(value.encode("utf-8"))
            return builder.finalize()



class DidProtocol(typing.Protocol):
    def resolve(self, ):
        raise NotImplementedError

class Did:

    _pointer: ctypes.c_void_p
    def __init__(self, text: "str"):
        _UniffiConverterString.check_lower(text)
        
        self._pointer = _rust_call(_UniffiLib.uniffi_didresolver_fn_constructor_did_new,
        _UniffiConverterString.lower(text))

    def __del__(self):
        # In case of partial initialization of instances.
        pointer = getattr(self, "_pointer", None)
        if pointer is not None:
            _rust_call(_UniffiLib.uniffi_didresolver_fn_free_did, pointer)

    def _uniffi_clone_pointer(self):
        return _rust_call(_UniffiLib.uniffi_didresolver_fn_clone_did, self._pointer)

    # Used by alternative constructors or any methods which return this type.
    @classmethod
    def _make_instance_(cls, pointer):
        # Lightly yucky way to bypass the usual __init__ logic
        # and just create a new instance with the required pointer.
        inst = cls.__new__(cls)
        inst._pointer = pointer
        return inst


    def resolve(self, ) -> "DidDoc":
        return _UniffiConverterTypeDidDoc.lift(
            _rust_call_with_error(
    _UniffiConverterTypeDidResolveError,_UniffiLib.uniffi_didresolver_fn_method_did_resolve,self._uniffi_clone_pointer(),)
        )





class _UniffiConverterTypeDid:

    @staticmethod
    def lift(value: int):
        return Did._make_instance_(value)

    @staticmethod
    def check_lower(value: Did):
        if not isinstance(value, Did):
            raise TypeError("Expected Did instance, {} found".format(type(value).__name__))

    @staticmethod
    def lower(value: DidProtocol):
        if not isinstance(value, Did):
            raise TypeError("Expected Did instance, {} found".format(type(value).__name__))
        return value._uniffi_clone_pointer()

    @classmethod
    def read(cls, buf: _UniffiRustBuffer):
        ptr = buf.read_u64()
        if ptr == 0:
            raise InternalError("Raw pointer value was null")
        return cls.lift(ptr)

    @classmethod
    def write(cls, value: DidProtocol, buf: _UniffiRustBuffer):
        buf.write_u64(cls.lower(value))


