# DidResolveError
# We want to define each variant as a nested class that's also a subclass,
# which is tricky in Python.  To accomplish this we're going to create each
# class separately, then manually add the child classes to the base class's
# __dict__.  All of this happens in dummy class to avoid polluting the module
# namespace.
class DidResolveError(Exception):
    pass

_UniffiTempDidResolveError = DidResolveError

class DidResolveError:  # type: ignore
    class DidNotSupported(_UniffiTempDidResolveError):

        def __repr__(self):
            return "DidResolveError.DidNotSupported({})".format(repr(str(self)))
    _UniffiTempDidResolveError.DidNotSupported = DidNotSupported # type: ignore
    class HttpError(_UniffiTempDidResolveError):

        def __repr__(self):
            return "DidResolveError.HttpError({})".format(repr(str(self)))
    _UniffiTempDidResolveError.HttpError = HttpError # type: ignore

DidResolveError = _UniffiTempDidResolveError # type: ignore
del _UniffiTempDidResolveError


class _UniffiConverterTypeDidResolveError(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return DidResolveError.DidNotSupported(
                _UniffiConverterString.read(buf),
            )
        if variant == 2:
            return DidResolveError.HttpError(
                _UniffiConverterString.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def check_lower(value):
        if isinstance(value, DidResolveError.DidNotSupported):
            return
        if isinstance(value, DidResolveError.HttpError):
            return

    @staticmethod
    def write(value, buf):
        if isinstance(value, DidResolveError.DidNotSupported):
            buf.write_i32(1)
        if isinstance(value, DidResolveError.HttpError):
            buf.write_i32(2)



class _UniffiConverterOptionalString(_UniffiConverterRustBuffer):
    @classmethod
    def check_lower(cls, value):
        if value is not None:
            _UniffiConverterString.check_lower(value)

    @classmethod
    def write(cls, value, buf):
        if value is None:
            buf.write_u8(0)
            return

        buf.write_u8(1)
        _UniffiConverterString.write(value, buf)

    @classmethod
    def read(cls, buf):
        flag = buf.read_u8()
        if flag == 0:
            return None
        elif flag == 1:
            return _UniffiConverterString.read(buf)
        else:
            raise InternalError("Unexpected flag byte for optional type")



